10 Things I Hate 4: I'm The Surprise
August 22, 2013
Allie is planning to surprise her girlfriend for Valentine's Day. She wasn't supposed to be home for a few days and neglected to get a gift. She stops in at the florist to see if anything is left to buy. Since it's the big day the shelves are bare, but the florist gives her an arrangement obviously made for a guy. Allie doesn't want to get in to the fact that her boyfriend is a girl so she takes what is offered. It didn't really matter anyway, Dana was thrilled to see her.
Pornstars: Allie Haze, Dana De Armond
